import React from 'react';
import './content.scss';

function LeftContent() {
  return(
    <div className="left-content">Left</div>
  )
}

function RightContent() {
  return(
    <div className="right-content">Right</div>
  )
}




function Home() {
  return(
    <div className="container">
      <LeftContent />,
      <RightContent />
    </div>
  )
}

export default Home;
